const Add = (a,b) => {
    return a + b ;
}

const Sub = (a,b) => {
    return a - b ;
}

const Mul = (a,b) => {
    return a * b ;
}

const Div = (a,b) => {
    return a / b ;
}

export default Add ;
export { Sub } ;
